import '../Register/'
import React, { useState } from 'react'
import { NavLink, useNavigate } from 'react-router-dom'

const SignIn = () => {


  const[Email, setEmail]=useState()
  const[Password, setPassword]=useState()

  console.log(Email)
  console.log(Password)
  let navigate = useNavigate();
  function HandleLogin (e){
    e.preventDefault();
    
    
    navigate("/all");
  }


  return (
    <div className='logincontainer'>
      <div>
        <form className='formcontainer' onSubmit={HandleLogin}>
          <h2>Sign In</h2>
          <p>New user? <NavLink to='/register'>Create account</NavLink></p>
          <input className='inputbox' type='email' placeholder='email' onChange={(e)=>setEmail(e.target.value)} required></input>
          <input className='inputbox' type='password' placeholder='password'onChange={(e)=>setPassword(e.target.value)} required></input>
          <label><input type="checkbox" className='checkboxs' /><span className='checkboxtext'> keep me signed in</span></label>
          <button type='submit'>Sign in</button>
          <p className='textbottom'><span>or sign in with</span></p>
        </form>
      </div>

      <div className='imgcontainer'>
        <img className='picture' src={require('../Images/SignIn.png')} alt='loading'></img>
      </div>
    </div>
  )
}

export default SignIn
